// import '../css/List.css'

export default class List extends React.Component{
    constructor(props) {
        super(props);
    }

    render() {
        const listItems = this.props.todoList.map((todo, index) => {
            return (


                //kokokara




                <li key={index}>{todo}</li>
            );
        });

        return (
            <ul>
                {listItems}
            </ul>
        );
    }
}
